    public static List<Integer> minPath(List<List<Integer>> grid, int k) {
        if (grid.isEmpty() || grid.get(0).isEmpty()) {
            return new ArrayList<>();
        }
        int n = grid.size();
        int m = grid.get(0).size();
        if (n == 1 && m == 1) {
            return Collections.singletonList(grid.get(0).get(0));
        }
        // Initialize the dp array
        int[][] dp = new int[n][m];
        for (int[] row : dp) {
            Arrays.fill(row, Integer.MAX_VALUE);
        }
        dp[0][0] = 0;
        // Bottom-up approach
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                if (i + 1 < n) {
                    dp[i + 1][j] = Math.min(dp[i + 1][j], dp[i][j] + grid.get(i + 1).get(j));
                }
                if (j + 1 < m) {
                    dp[i][j + 1] = Math.min(dp[i][j + 1], dp[i][j] + grid.get(i).get(j + 1));
                }
            }
        }
        // Find the minimum path
        List<Integer> minPath = new ArrayList<>();
        int i = n - 1;
        int j = m - 1;
        while (i >= 0 && j >= 0) {
            minPath.add(grid.get(i).get(j));
            if (i + 1 < n && dp[i + 1][j] < dp[i][j]) {
                i += 1;
            } else {
                j -= 1;
            }
        }
        Collections.reverse(minPath);
        return minPath;

